    return (
        
        <div class="profile-exp bg-white p-2">
          <h2 class="text-primary">Experience</h2>
          profile.profile.experience.map(exp =>{
            <div>
              <h3 class="text-dark">{exp.company}</h3>
              <p>{exp.from } - current</p>
              <p><strong>Position: </strong>Senior Developer</p>
